import React, { useState } from "react";
import axios from "axios";
import "./header.css";

function getResult(feedingOption, keyword, selectedFile) {}
function AddStudent() {
  const [isLogin, setIsLogin] = useState(false);

  const [step, setStep] = useState(1);
  const [feedingOption, setFeedingOption] = useState(1);
  const [isRunDetector, setIsRunDetector] = useState(true);
  const [keyword, setKeyword] = useState("");
  const [max_tweets, setMaxTweets] = useState(5);
  const [dataset, setDataset] = useState([]);
  const [newstext, setNewsText] = useState("");

  const [selectedFile, setSelectedFile] = useState();
  const [isFilePicked, setIsFilePicked] = useState(false);
  const [result, setResult] = useState([]);

  const changeHandler = (event) => {
    setSelectedFile(event.target.files[0]);
  };

  const runFNDetector = () => {
    setIsRunDetector(true);
    if(feedingOption === 1){
      axios
      .get(
        `http://207.254.64.136:5000/fetchtweets?keyword=${keyword}&max_tweets=10`
      )
      .then((e) => {
        axios.get(`http://207.254.64.136:5000/predict`).then((e) => {
          //setIsRunDetector(true);
          console.log(e);
          setResult(e.data);
          const obj = e.data.data.text;
          const { labels1, labels2, labels3 } = e.data;
          const txt = Object.keys(obj).map((key) => {
            return {
              text: obj[key],
              rslt1: labels1[key],
              rslt2: labels2[key],
              rslt3: labels3[key],
            };
          });
          setDataset(txt);
        });
      });
    }

    if(feedingOption === 2){
      var bodyFormData = new FormData();
      bodyFormData.append("file", selectedFile)
      axios({
        method: "post",
        url: `http://207.254.64.136:5000/fileupload`,
        data: bodyFormData,
        headers: { "Content-Type": "multipart/form-data" },
      }).then((e) => {
          //setIsRunDetector(true);
          console.log(e);
          setResult(e.data);
          const obj = e.data.data.text;
          const { labels1, labels2, labels3 } = e.data;
          const txt = Object.keys(obj).map((key) => {
            return {
              text: obj[key],
              rslt1: labels1[key],
              rslt2: labels2[key],
              rslt3: labels3[key],
            };
          });
          setDataset(txt);
        });
    }

    if(feedingOption === 3){
      var bodyFormData = new FormData();
      bodyFormData.append("newstext", newstext)
      axios({
        method: "post",
        url: `http://207.254.64.136:5000/predictwithatext`,
        data: bodyFormData,
        headers: { "Content-Type": "multipart/form-data" },
      }).then((e) => {
          //setIsRunDetector(true);
          console.log(e);
          setResult(e.data);
          const obj = e.data.data.text;
          const { labels1, labels2, labels3 } = e.data;
          const txt = Object.keys(obj).map((key) => {
            return {
              text: obj[key],
              rslt1: labels1[key],
              rslt2: labels2[key],
              rslt3: labels3[key],
            };
          });
          setDataset(txt);
        });
    }
  };

  return (
    <React.Fragment>

      <div className="container" id="daterangepicker-container">
        <div className="row">
          <div className="col-lg-12">
          <h4 class="m-t-3">Add Student</h4>

          <form class="form-horizontal">
                <div class="form-group">
                    <label for="inputEmail3" class="col-sm-3 control-label">Name</label>
                    <div class="col-sm-9">
                        <input type="email" class="form-control" id="inputEmail3" />
                    </div>
                </div>
                <div class="form-group">
                    <label for="inputEmail3" class="col-sm-3 control-label">Andrew Id</label>
                    <div class="col-sm-9">
                        <input type="email" class="form-control" id="inputEmail3" />
                    </div>
                </div>
                <div class="form-group">
                    <label for="inputEmail3" class="col-sm-3 control-label">Photo</label>
                    <div class="col-sm-9">
                        <input type="file" class="form-control" id="inputEmail3" />
                    </div>
                </div>
                <button type="submit" class="btn btn-primary">Save</button>
            </form>
          </div>
        </div>

      </div>
    </React.Fragment>
  );
}

export default AddStudent;
